function Card(props)
{
    return(
        <div class="card">
            <img class="card-img-top" src="" alt="logo"/>
            <div class="card-body">
                <h3 class="card-title">{props.props.title}</h3>
                <p class="card-text">{props.props.description}</p>
            </div>
        </div>
    )
}

export default Card;
